import sys
from PyQt5.QtWidgets import QApplication, QSplashScreen
from PyQt5.QtGui import QPixmap

# Base64 이미지 데이터
base64_image_data = """

"""

def get_pixmap_from_base64(base64_data):
    import base64
    from PyQt5.QtGui import QPixmap
    image_data = base64.b64decode(base64_data)
    pixmap = QPixmap()
    pixmap.loadFromData(image_data)
    return pixmap

if __name__ == "__main__":
    app = QApplication(sys.argv)

    # 스플래시 화면 표시
    pixmap = get_pixmap_from_base64(base64_image_data)
    splash = QSplashScreen(pixmap)
    splash.show()

    # 메인 프로그램 로딩 대기 (3초 시뮬레이션)
    import time
    time.sleep(2)
    splash.close()